Here is a sample Spark job that calculates the hit rate for onsite attributed data:
```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable
import scala.collection.mutable.Map

object HitRateCalculator {
  def main(args: Array[String]): Unit = {
    val spark = SparkSession.builder()
      .appName("HitRateCalculator")
      .master("local[*]")
      .getOrCreate()

    val sc = spark.sparkContext

    // Load onsite attributed data
    val onsiteData: JavaRDD[String] = sc.textFile("onsite_data.txt")

    // Load top frequent queries
    val topQueries: JavaRDD[String] = sc.textFile("top_queries.txt")

    // Broadcast top queries to all nodes
    val broadcastTopQueries: Broadcast[Array[String]] = sc.broadcast(topQueries.collect())

    // Initialize cache
    val cache: Map[String, (Long, Long)] = mutable.Map()

    // Process onsite data
    val hitRate = onsiteData.map(line => {
      val Array(query, timestamp) = line.split(" ")
      val timestampLong = timestamp.toLong

      // Check if query is in top queries
      if (broadcastTopQueries.value.contains(query)) {
        // Check if query is in cache
        if (cache.contains(query)) {
          val (lastAccessTime, hitCount) = cache(query)

          // Check if query is still in cache
          if (timestampLong - lastAccessTime <= 12 * 60 * 60) {
            // Update cache
            cache(query) = (timestampLong, hitCount + 1)

            // Return hit
            (1, 1)
          } else {
            // Remove query from cache
            cache.remove(query)

            // Return miss
            (0, 1)
          }
        } else {
          // Add query to cache
          cache(query) = (timestampLong, 1)

          // Return miss
          (0, 1)
        }
      } else {
        // Return 0 for both hit and miss
        (0, 0)
      }
    }).reduce((a, b) => (a._1 + b._1, a._2 + b._2))

    // Calculate hit rate
    val hitRateDouble = hitRate._1.toDouble / hitRate._2.toDouble

    println(s"Hit rate: $hitRateDouble")

    spark.stop()
  }
}
```
This job first loads the onsite attributed data and top frequent queries from text files. It then broadcasts the top frequent queries to all nodes in the cluster.

The job then initializes a cache to store the queries that have been retrieved and cached. For each record in the onsite attributed data, the job checks if the query is in the top frequent queries and if it is in the cache. If the query is in the cache and has not expired, the job updates the cache and returns a hit. If the query is not in the cache or has expired, the job adds the query to the cache and returns a miss.

Finally, the job calculates the hit rate by dividing the total number of hits by the total number of queries processed.

