Shopify does not provide a built-in API for currency conversion. However, you can use third-party APIs like Open Exchange Rates, Fixer.io, or Currencylayer to convert currencies. You can then integrate these APIs into your Shopify store using custom code or apps.

To use these APIs, you'll need to sign up for an account and obtain an API key. Once you have the API key, you can make requests to the API to get the latest exchange rates and perform currency conversions.

Here's an example of how you might use the Open Exchange Rates API to convert a price from USD to EUR:
```javascript
const axios = require('axios');

const apiKey = 'YOUR_API_KEY';
const baseUrl = 'https://openexchangerates.org/api/latest.json';

async function convertCurrency(amount, fromCurrency, toCurrency) {
  try {
    const response = await axios.get(`${baseUrl}?app_id=${apiKey}`);
    const rates = response.data.rates;
    const conversionRate = rates[toCurrency] / rates[fromCurrency];
    const convertedAmount = amount * conversionRate;
    return convertedAmount;
  } catch (error) {
    console.error(error);
  }
}

// Example usage:
convertCurrency(100, 'USD', 'EUR')
  .then(result => console.log(result))
  .catch(error => console.error(error));
```
This code uses the `axios` library to make a GET request to the Open Exchange Rates API and retrieve the latest exchange rates. It then calculates the conversion rate between the two currencies and returns the converted amount.

You can use this code as a starting point and modify it to fit your specific needs. Keep in mind that you'll need to handle errors and edge cases, such as when the API returns an error or when the conversion rate is not available

